import { children } from "react"

export default function Navbar() {

    return (
        <nav className="nav">
            <a href="/" className="site-name">Halal Food Finder</a>
            <ul>
                <CustomLink href="/home">Home</CustomLink>
                <CustomLink href="/restaurant">Restaurants</CustomLink>
                <CustomLink href="/map">Map</CustomLink>
                <CustomLink href="/recommendation">Recommendation</CustomLink>
                <CustomLink href="/sign_in">Sign In</CustomLink>
            </ul>
        </nav>
    )
}

function CustomLink({ href, children, ...props }) {
    const path = window.location.pathname
    return (
        <li className={path === href ? "active" : ""}>
            <a href={href} {...props}>{children}</a>
        </li>
    )
}
